import React, { useState } from 'react';

interface ServiceSummary {
  service: string;
  date: string;
  nextStep: string;
  notes: string;
}

interface FormData {
  basic: {
    organizationName: string;
    navigatorName: string;
    intakeDate: string;
  };
  participant: {
    firstName: string;
    middleName: string;
    lastName: string;
    dateOfBirth: string;
    gender: string;
    countryOfOrigin: string;
    preferredLanguage: string;
    phoneNumber: string;
    email: string;
    streetAddress: string;
    city: string;
    state: string;
    zipCode: string;
    county: string;
    mailingAddress: string;
    sameAsResidential: boolean;
    dshsClientId: string;
    alienNumber: string;
  };
  services: {
    summary: ServiceSummary[];
  };
}

const CommunityIntakeForm: React.FC = () => {
  const [formData, setFormData] = useState<FormData>({
    basic: {
      organizationName: '',
      navigatorName: '',
      intakeDate: ''
    },
    participant: {
      firstName: '',
      middleName: '',
      lastName: '',
      dateOfBirth: '',
      gender: '',
      countryOfOrigin: '',
      preferredLanguage: '',
      phoneNumber: '',
      email: '',
      streetAddress: '',
      city: '',
      state: 'Washington',
      zipCode: '',
      county: '',
      mailingAddress: '',
      sameAsResidential: false,
      dshsClientId: '',
      alienNumber: ''
    },
    services: {
      summary: []
    }
  });

  const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      participant: {
        ...prev.participant,
        [name]: value,
      },
    }));
  };

  const handleBasicChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      basic: {
        ...prev.basic,
        [name]: value,
      },
    }));
  };

  return (
    <div className="max-w-4xl mx-auto p-6">
      <h1 className="text-2xl font-bold text-center mb-8">Community Outreach and Education Intake/Registration Form</h1>

      <form className="space-y-8">
        <section className="border p-4 rounded bg-gray-100">
          <h2 className="text-xl font-semibold mb-4">Basic Information</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            <input
              type="text"
              name="organizationName"
              value={formData.basic.organizationName}
              onChange={handleBasicChange}
              placeholder="Organization Name"
              className="w-full p-2 border border-gray-400 rounded"
            />
            <input
              type="text"
              name="navigatorName"
              value={formData.basic.navigatorName}
              onChange={handleBasicChange}
              placeholder="Navigator Name"
              className="w-full p-2 border border-gray-400 rounded"
            />
            <input
              type="date"
              name="intakeDate"
              value={formData.basic.intakeDate}
              onChange={handleBasicChange}
              className="w-full p-2 border border-gray-400 rounded"
            />
          </div>
        </section>

        <section className="border p-4 rounded bg-gray-100">
          <h2 className="text-xl font-semibold mb-4">Participant Information</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            {Object.entries(formData.participant).map(([key, value]) => (
              <input
                key={key}
                type="text"
                name={key}
                value={value as string}
                onChange={handleChange}
                placeholder={key.replace(/([A-Z])/g, ' $1')}
                className="w-full p-2 border border-gray-400 rounded"
              />
            ))}
          </div>
        </section>

        <button type="submit" className="bg-blue-500 text-white px-4 py-2 rounded">
          Submit
        </button>
      </form>
    </div>
  );
};

export default CommunityIntakeForm;
